// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { selectionSummaryRenderFunction } from 'js/SelectionSummary';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/SelectionSummary', () => import('js/SelectionSummary'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "i18n": {
        "selected": [
            "UIMessages"
        ]
    },
    "actions": {
        "render": {
            "method": "selectionSummaryRenderFunction",
            "deps": "js/SelectionSummary"
        }
    },
    "lifecycleHooks": {
        "render": "render"
    },
    "props": {
        "sub-panel-context": {
            "type": "object"
        }
    },
    "_viewModelId": "SelectionSummary",
    "_uniqueViewModelId": "SelectionSummary",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, selectionSummaryRenderFunction, undefined, ctxImportObj );

export default Component;
